@Skhozyeal هل من الممكن تفاصيل اكثر.
مع كامل الاعتذار لشخصكم الكريم عما بدر مننا ولم ينال اعجابكم.
و شاكرين لكم دائماً تواصلكم مع الخطوط الجوية الكويتية

@ShahadAl7_ عزيزنا العميل نعتذر عما بدر من تأخير 
يرجى التواصل معنا على الخاص لتزويدنا ببعض المعلومات.
شاكرين تواصلك مع الخطوط الجوية الكويتيه ونتمنى لكم يوم سعيد

@ENG_QQ8 عزيزنا العميل ستقلع ان شاء الله من المطار الجديد ( T4 ) 
و يحق لك حقيبتين فقط وكل حقيبه لا يتعدى الوزن 23 كيلو اي بمجموع 46 كيلو.
وشكراً لاختياركم الخطوط الجوية الكويتية دائماً

@MrQ8ti عميلنا العزيز , بشكل عام يستطيع خدمة العملاء مساعدتكم بانجاز المعامله. ولكن نعم توجد حالات تستدعي الذهاب الى احدى مكاتبنا لانجاز المعامله , هل من الممكن تزويدي برقم الحجز على الخاص.
مستقبلاً سنقوم بخدمتكم بشكل اسرع واسهل ان شاء الله.
وشكراً لاختياركم الخطوط الجوية الكويتية دائماً

@zahradashti1960 @hanialmathkoor @kuwaitq81973 @Kuwait_DGCA نعم عزيزنا العميل جدول الرحلات الاسبوعي للمدينة المنوره : 
" الاحد - الخميس - الجمعه " و تُقلع في الساعه : 0900 صباحاً
شاكرين تواصلك مع الخطوط الجوية الكويتيه ونتمنى لك يوم سعيد

@Boghala_kw عزيزنا العميل يرجى تزويدنا على الخاص بتاريخ الرحله و رقم الرحله
ولمزيد من المعلومات خدمة العملاء 171 متواجده على مدار الساعه.
 شاكرين لك تواصلك معنا في الخطوط الجوية الكويتية

@Bader_Alt يسرنا خدمتكم عزيزي العميل في اي وقت وعلى مدار الساعه 
تستطيع الحجز عن طريق موقعنا الرسمي او برنامجنا في الهواتف الذكيه
او عن طريق خدمة العملاء 171 الموجوده على مدار الساعه لخدمتكم في امور الحجز
